            watch.Start();
            try
            {
                Parallel.ForEach(addressList, (address) =>
                {
                    var addAddress = new AddressReturn();
                    try
                    {
                        addAddress = _AddressProcessing.ProcessAddress(address);
                    }
                    catch (Exception e)
                    {
                        addAddress.ValidAddress = false;
                        addAddress.errorMessage = e.Message;
                    }
                    returnList.Add(addAddress);
                });
            }
            catch (Exception e)
            {
                Assert.Fail($"ProcessManyAddresses Error:{e.Message}");
            }
            watch.Stop();
            Console.WriteLine($"{addressList.Count} addresses processed in {watch.ElapsedMilliseconds} ms.");
            Assert.IsTrue(returnList.All(x => string.IsNullOrWhiteSpace(x.errorMessage)));

        }
    }
}
